def decode_tfidf():
    tfidf = {}
    for record in TFIDF.split(";"):
        l = record.split(",")
        tfidf[l[0]] = [int(l[i]) / 100 for i in range(1,4)]
    return tfidf

def main():
    tfidf = decode_tfidf()
    z = input()
    for _ in range(int(z)):
        line = input()
        for p in string.punctuation + "1234567890":
            line = line.replace(p, "")
        line = line.lower().split()
        line = [w for w in line if w]
        score = [1,1,1]
        for word in line:
            if word in tfidf.keys():
                for i in range(3):
                    score[i] *= tfidf[word][i]

        print(AUTHORS[score.index(max(score))])

main()
